import React from "react";
import TableRow from "../molecules/users/TableRow";

interface Props {
  users: {
    id: number;
    firstName: string;
    lastName: string;
    attribute: string;
    email: string;
    status: string;
    verified?: boolean;
  }[];
  onCellClick: (
    id: number,
    firstName: string,
    lastName: string,
    email: string
  ) => void;
}

const UserTable: React.FC<Props> = ({ users, onCellClick }) => (
  <table className="w-full">
    <thead>
      <tr>
        <th className="py-2.5 pr-4 pl-4 text-left text-neutral-500 font-medium uppercase bg-neutral-50">
          ID
        </th>
        <th className="py-2.5 pr-4 pl-4 text-left text-neutral-500 font-medium uppercase bg-neutral-50">
          First Name
        </th>
        <th className="py-2.5 pr-4 pl-4 text-left text-neutral-500 font-medium uppercase bg-neutral-50">
          Last Name
        </th>
        <th className="py-2.5 pr-4 pl-4 text-left text-neutral-500 font-medium uppercase bg-neutral-50">
          Attribute
        </th>
        <th className="py-2.5 pr-4 pl-4 text-left text-neutral-500 font-medium uppercase bg-neutral-50">
          Email
        </th>
        <th className="py-2.5 pr-4 pl-4 text-left text-neutral-500 font-medium uppercase bg-neutral-50">
          Status
        </th>
      </tr>
    </thead>
    <tbody>
      {users.map((user) => (
        <TableRow
          key={user.id}
          id={user.id}
          firstName={user.firstName}
          lastName={user.lastName}
          attribute={user.attribute}
          email={user.email}
          status={user.status}
          verified={user.verified}
          onCellClick={onCellClick}
        />
      ))}
    </tbody>
  </table>
);

export default UserTable;
